import React from 'react';
import Card from './Card.js';
import SourceData from './Sourcedata.js';

const CardList = (props) => {
    return (
        <div className="row">
            {SourceData}
            <Card {...SourceData[0]} />
            <Card {...SourceData[1]} />
        </div>
    )
}

export default CardList;
